import React, {Component} from "react";
import {connect} from "react-redux";
import PropTypes from "prop-types";

const mapReduxStateToProps = reduxState => ({

});

const mapReduxDispatchToProps = {

};

export default connect(mapReduxStateToProps, mapReduxDispatchToProps)(
    class ModalEmail extends Component {

        static propTypes = {
            showModalEmail: PropTypes.bool,
            closeModalEmail: PropTypes.func,
            modalTitle: PropTypes.string,
        }

        constructor(props) {
            super(props);

            this.state = {
               email: "",
            };
        }


        render(){
            return (
            <div>
                <div className="modal fade slide-front" id="modalEmail" tabIndex="9" role="dialog" hidden={!this.props.showModalEmail} aria-hidden="true">
                    <div className="modal-dialog modal-dialog-centered">
                        <div className="modal-content">
                            <div className="modal-header clearfix text-left">
                                <h5><span className="bold">{this.props.modalTitle}</span></h5>
                            </div>
                            <div className="modal-body">
                                <div className="row">
                                    <div className="col-lg-12">
                                        <label>Email</label>
									    <input className="au-input au-input--full"
											   required={true}
											   id="email"
											   name="email"
											   value={this.state.email}
											   onChange={this.handleChange}
											   placeholder="E-mail"/>
                                    </div>
                                </div>
                                <div className="row">
                                    <div className="col-lg-12">
                                    <label>Email</label>
                                        <button className="btn btn-success btn-cons"
                                                            type="submit">Salvar
                                        </button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )}
    }


);
